So… I did a thing two months ago — I joined @thepolecamp Beginners Pole Batch, and honestly, it has been one of the best decisions of my entire life. 🥹❤️
My pole journey began as a silent dream back in 2021 when I stumbled upon @anushaswamy profile. From that moment on, learning pole from her became a distant, sparkly dream. Fast forward to today — from admiring her as a stranger online, to travelling to Vietnam with her, to now being guided by her in class… it still doesn’t feel real. ✨
@anushaswamy — you are magic. You are not just teaching pole, you’re transforming lives, including mine. You’ve inspired me deeply, and continue to do so every single day. Forever grateful for you and everything you’ve unknowingly done for me and so many others. ♥️
@prarthanasrinivasaraja — you are hands-down one of the best beginner instructors ever. Your patience, warmth, and guidance made all the difference. Also, out of topic but just had to say it — you’re so effortlessly pretty😭♥️
@_ms.raju_ @monika.selvan_ @vasundhra.verma7 — thank you for being the relentless energy, strength, and motivation that kept us pushing every single weekend. This whole experience would have been incomplete without your unwavering support and hype.
To every single person I met during this journey — you now carry a piece of my heart. ♥️
Can’t wait to return, to continue this journey, to fall and rise again — but stronger. Till then, I’m holding on to every memory with so much love. See you all real soon 🥹✨💫

